import React from "react";
import ReactAnimatedWeather from "react-animated-weather";
import "./WeekWeatherStyle.css";

export default function Icon(props) {
  const codeMapping = {
    "01d": "CLEAR_DAY",
    "01n": "CLEAR_NIGHT",
    "02d": "",
    "02n": "PARTLY_CLOUDY_NIGHT",
    "03d": "CLOUDY",
    "03n": "CLOUDY",
    "04d": "CLOUDY",
    "04n": "CLOUDY",
    "09d": "RAIN",
    "09n": "RAIN",
    "010d": "RAIN",
    "010n": "RAIN",
    "011d": "PARTLY_CLOUDY_DAY",
    "011n": "PARTLY_CLOUDY_NIGHT",
    "012d": "CLOUDY",
    "012n": "CLOUDY",
    "013d": "",
    "013n": "PARTLY_CLOUDY_NIGHT",
    "50d": "CLOUDY",
    "50n": "CLOUDY",
  };

  CLEAR_DAY;
  CLEAR_NIGHT;
  ;
  PARTLY_CLOUDY_NIGHT;
  CLOUDY;
  RAIN;
  SLEET;
  SNOW;
  WIND;
  FOG;

  return (
    <ReactAnimatedWeather
      icon={codeMapping[props.code]}
      color="black"
      size={25}
      animate={false}
    />
  );
}
